export default function MovieList({title,movies}) {

    
  return (
    <div className='px-8'>
        <h1 className='text-3xl text-white'>{title}</h1>
        <div >
            <div className='flex items-center'>
                <MovieCard/>
                <MovieCard/>
                <MovieCard/>
                <MovieCard/>
            </div>
        </div>
    </div>
  )
}
